//m.media-amazon.com/images/M/MV5BMTcxNDEyNzgzOV5BMl5BanBnXkFtZTcwMDczNDgwMw@@._V1_SY1000_CR0,0,1536,1000_AL_.jpg"},{name:"The War of the Worlds: Next Century",year:1981,directed:"Piotr Szulkin",starring:"Will Smith, Bill Pullman, Jeff Goldblum",image:"https://m.media-amazon.com/images/M/MV5BNDJiNTBjZjgtZWY0NC00N2M3LTk5ODQtODA4Mzk4ZjE4OTA5XkEyXkFqcGdeQXVyOTc5MDI5NjE@._V1_.jpg"},{name:"The War of the Worlds",year:1953,directed:"Byron Haskin",starring:"Will Smith, Bill Pullman, Jeff Goldblum",image:"https://m.media-amazon.com/images/M/MV5BMjA5MjQ0MzU0NF5BMl5BanBnXkFtZTcwNjMwOTgxOA@@._V1_SY1000_CR0,0,1264,1000_AL_.jpg"}]},{title:"Heart of Darkness",author:"Joseph Conrad",year:1902,themes:"Novella, Colonial Literature, Adventure Tale, European Imperialism",quote:"“Like a running blaze on a plain, like a flash of lightning in the clouds. We live in the flicker.”",summary:"The finest of all Conrad's tales, Heart of Darkness is set in an atmosphere of mystery and menace, and tells of Marlow's perilous journey up the Congo River to relieve his employer's agent, the renowned and formidable Mr. Kurtz. What he sees on his journey, and his eventual encounter with Kurtz, horrify and perplex him, and call into question the very bases of civilization and human nature.",category:"Adventure",fantasyBookBoolean:!1,romanceBookBoolean:!1,historyBookBoolean:!1,adventureBookBoolean:!0,firstRow:!1,secondRow:!0,selectedFilm:3,slug:"hearts-of-darkness",adaptations:[{name:"Ad Astra",year:2019,selectedMovie:!1,image:"https://m.media-amazon.com/images/M/MV5BOThiMThjOTYtMDFjZi00OWU1LWFlYzUtNDZjMmQyZjFlMjliXkEyXkFqcGdeQXVyNjg2NjQwMDQ@._V1_SX1777_CR0,0,1777,744_AL_.jpg",awards:null},{name:"Heart of Darkness: A Filmmaker's Apocalypse",year:1991,selectedMovie:!1,image:"https://m.media-amazon.com/images/M/MV5BNGI5OWU5ZmItOWM0Ni00Y2JiLWIyNTUtMmU4ZjM2YjA4ZmI0XkEyXkFqcGdeQXVyMjUyNDk2ODc@._V1_SX1777_CR0,0,1777,999_AL_.jpg"},{name:"Heart of Darkness",year:1993,selectedMovie:!1,image:"https://m.media-amazon.com/images/M/MV5BYmI0MjE0Y2MtMTUzNy00MGU5LThjMTktMWUzMWZlZmU3YjJjXkEyXkFqcGdeQXVyMjUyNDk2ODc@._V1_.jpg",awards:null},{name:"Apocalypse Now",year:1979,selectedMovie:!1,image:"https://m.media-amazon.com/images/M/MV5BMTc5OTI5MzAxMl5BMl5BanBnXkFtZTcwNDYyNDY4Mw@@._V1_SY1000_CR0,0,1465,1000_AL_.jpg",awards:[{name:"Academy Award Winner",categories:["Best Cinematography","Best Sound"]},{name:"Golden Globe Winner",categories:["Best Director","Best Supporting Actor","Best Original Score"]},{name:"BAFTA Winner",categories:["Best Direction","Best Supporting Actor"]}]}]},{title:"The Scarlet Letter",author:"Nathaniel Hawthorne",year:1850,themes:"Historical Romance, Colonial America, Puritans, Adultury, Revenge",summary:"Set on a Bengali noble's estate in 1908, this is both a love story and a novel of political awakening. The central character, Bimala, is torn between the duties owed to her husband, Nikhil, and the demands made on her by the radical leader, Sandip. Her attempts to resolve the irreconciliable pressures of the home and world reflect the conflict in India itself, and the tragic outcome foreshadows the unrest that accompanied Partition in 1947.",quote:"“On the breast of her gown, in fine red cloth, surrounded with an elaborate embroidery and fantastic flourishes of gold thread, appeared the letter A.”",fantasyBookBoolean:!1,romanceBookBoolean:!1,historyBookBoolean:!0,adventureBookBoolean:!1,category:"Historical",firstRow:!1,secondRow:!0,selectedFilm:2,slug:"the-scarlet-letter",adaptations:[{name:"The Scarlet Letter",year:2015,directed:"Elizabeth Berry",starring:"Molly Wilson, Kevin Wegner, John Risner",image:"https://m.media-amazon.com/images/M/MV5BYTgzMzRmNjgtOGNiNi00MmI1LTliODUtZjk2M2YwNDE2NWNmXkEyXkFqcGdeQXVyNTAwMzI0OTg@._V1_SY1000_SX1504_AL_.jpg"},{name:"Easy A",year:2010,directed:"Will Gluck",starring:"Emma Stone, Penn Badgley, Amanda Bynes",image:"https://m.media-amazon.com/images/M/MV5BNzk5NzQzNDUwMV5BMl5BanBnXkFtZTcwMzYzNDY4Mw@@._V1_SX1500_CR0,0,1500,999_AL_.jpg"},{name:"The Scarlet Letter",year:1995,directed:"Roland Jeffe",starring:"Molly Wilson, Kevin Wegner, John Risner",faithfulness:"Significantly deviates",image:"https://m.media-amazon.com/images/M/MV5BMjE0NzE5NzgzNl5BMl5BanBnXkFtZTcwMzU3NjgwMw@@._V1_SY1000_CR0,0,1576,1000_AL_.jpg"},{name:"The Scarlet Letter",year:1973,directed:"Wim Wenders",starring:"Senta Berger, Hans Christian Blech, Lou Castel",faithfulness:"Significantly deviates",image:"https://m.media-amazon.com/images/M/MV5BZTdhMzczNjItNGNlZC00MGVjLWE0NWQtOGEyOGRiMzJlNjFjXkEyXkFqcGdeQXVyOTc5MDI5NjE@._V1_.jpg"},{name:"The Scarlet Letter",year:1934,directed:"Robert G. Vignola",starring:"Colleen Moore, Henry B. Walthall, Betty Blythe",faithfulness:"Faithful",image:"https://m.media-amazon.com/images/M/MV5BMmU2YzQ1NDItYzRhNC00OWJlLWIwNzEtZDBkNjFkZWY5MTdmXkEyXkFqcGdeQXVyMjcxNjI4NTk@._V1_.jpg"},{name:"The Scarlet Letter",year:1926,directed:"Victor Sjostrom",starring:"Lillian Gish, Lars Hanson, Henry B. Walthall",faithfulness:"",image:"https://m.media-amazon.com/images/M/MV5BNGFkMTI5NDQtNjgyMS00YzFlLTk1MzEtNWI2YmEwOTVmNjQ2XkEyXkFqcGdeQXVyNjY0NzAxOTk@._V1_SX1242_CR0,0,1242,999_AL_.jpg"},{name:"The Scarlet Letter",year:1917,country:"",directed:"Carl Harbaugh",starring:"Stuart Holmes, Kittens Reichert",faithfulness:"",image:"https://m.media-amazon.com/images/M/MV5BN2ViM2VmMGUtMDM3Mi00MWYyLWIwZDEtY2M1MDgxZmQzOTlmXkEyXkFqcGdeQXVyMDUyOTUyNQ@@._V1_.jpg"}]},{title:"Pygmalion",author:"George Bernard Shaw",quote:"“I sold flowers. I didn't sell myself. Now you've made a lady of me I'm not fit to sell anything else.”",themes:"Play, Transformation, Class Division & Social Mobility",summary:"In Shaw's clever adaptation, Professor Henry Higgins, a linguistic expert, takes on a bet that he can transform an awkward cockney flower seller into a refined young lady simply by polishing her manners and changing the way she speaks. In the process of convincing society that his creation is a mysterious royal figure, the Professor also f